import {
    createBrowserRouter,
    RouterProvider,
  } from "react-router-dom";

  import Wrap1 from "./Wrap";
import {Blog} from "./Blog"
import Layout from "./Layout"

  const router = createBrowserRouter([
    {
      path: "/",
      element: <Layout/>,
      Children: [
        {
          path:"/",
          element:<Wrap1/>
        },{
          path:"/blog",
          element:<Blog/>
        }
      ]
    },
  ]);

  function PageRouter(){
    return(
        <RouterProvider router={router}/>
    )
  }

  export default PageRouter;
